import Header from "./components/Header";
import Container from "./components/Container";
import Card from "./components/Card";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Container />
        {/* <Card /> */}
      </div>
    );
  }
}

export default App;
